            <h1 style={{textAlign:'center'}}>PRODUCTS PAGE!</h1>
            <ul>
                <li><Link to='./productdetail'>P1</Link></li>
                <li><Link to='./productdetail'>P2</Link></li>
                <li><Link to='./productdetail'>P3</Link></li>
                <li><Link to='./productdetail'>P4</Link></li>
            </ul>
        </React.Fragment>
    )
}

export default Products;
